import React, { useState, useEffect } from 'react';
import {useCookies} from 'react-cookie';
import axios from 'axios';

const TICKET_URL = 'http://localhost:8000/api/ticket-list';

const Profile = () => {
    const [cookies, setCookies] = useCookies(['users']);
    const [tickets, setTickets] = useState({});
   
    useEffect(() => {
        const getTickets = async () => {
            const {data: res} = await axios.get(TICKET_URL)
            setTickets(res);
        };
        getTickets();
    }, [])
    
    // const data = tickets.tickets.map((ticket) => (
        
    //     console.log(ticket.name);
    // ));

        // if(ticket.name === cookies.users.name && ticket.lastname === cookies.users.lastname)
        // {
        // }
    
    // console.log(tickets.name);
    // if(ticket.name === cookies.users.name && ticket.lastname === cookies.users.lastname)
    // {
    //     console.log(ticket);
    // }
    return(
        <>
            <div className='container d-flex profile justify-content-center'>
                {/* {tickets.tickets.map((ticket) => {
                    return ticket.name === cookies.users?.name ? 
                    <p>{ticket.name}</p>
                    :
                    ""
                })} */}
                {cookies.users ? tickets.tickets.map((ticket) => {
                    return cookies.users.map((user) => {
                        return ticket.name === user.name ?
                        <div className="card card-ticket text-center">
                            <div className="card-header">
                                Loterijos bilietas #{ticket.ticketNumber}
                            </div>
                            <div className='card-body'>
                                <p>{ticket.name}</p>
                                <p>{ticket.lastname}</p>
                            </div>
                        </div>
                        :
                        ""

                    })
                }
                ): (
                    <div className="card card-ticket text-center">
                        <div className="card-header">
                            Informacija
                        </div>
                        <div className='card-body'>
                            <p>Šiuo metu neturite įsigyjęs loterijos bilieto</p>
                        </div>
                    </div>
                )}
            </div>
        </>
    )
}

export default Profile;
